import React, { Component } from 'react';
import './Query.css';

class Query extends Component {
    state = {
        result: ""
    }
    
    render() {
        return (
            <div className="query-contatiner">
                Query Page {this.props.keyword}
            </div>
        )
    }
}

export default Query;
